		 $scope.selection_process = function(brn,itm,prd,desnum,ival) {
		var count=document.getElementById('select_count').value;
		var tot_count= +count+1;
		document.getElementById('select_count').value=tot_count;
		document.getElementById('tot_select').innerHTML=tot_count;
		var pending_cou=document.getElementById('total_count').value;
		var tot_cou= pending_cou-1;
		document.getElementById('total_count').value=tot_cou;
		document.getElementById('tot').innerHTML=tot_cou;
		var brn_val = document.getElementById('sel_brn').value;
		var chk1 = brn +'/'+ itm +'/'+ prd +'/'+ desnum +'/'+ ival +'/'+ brn_val 
		$.ajax({
		type: 'POST',url: 'branch_insert.php?num='+chk1,
		success: function(data) {
		document.getElementById('hide_ajx_'+ival).style.display = 'none';
		document.getElementById('select_'+ival).style.display = 'block';
		document.getElementById('select_ajx_'+ival).style.display = 'block';},
		})
		
		};$scope.remove_select = function(brn,itm,prd,desnum,ival) {
		var chk2 = brn +'/'+ itm +'/'+ prd +'/'+ desnum +'/'+ ival ; 
		$.ajax({
		type: 'POST',url: 'branch_remove.php?num='+chk2,
		success: function(data) {
		document.getElementById('hide_ajx_'+ival).style.display = 'block';
		document.getElementById('select_'+ival).style.display = 'none';
		document.getElementById('select_ajx_'+ival).style.display = 'none';
		var count_remove=document.getElementById('select_count').value;
		var tot_count= count_remove-1;
		document.getElementById('select_count').value=tot_count;
		document.getElementById('tot_select').innerHTML=tot_count;
		var pending_cou_remove=document.getElementById('total_count').value;
		var tot_cou= +pending_cou_remove+1;
		document.getElementById('total_count').value=tot_cou;
		document.getElementById('tot').innerHTML=tot_cou;
		},
		})}
